import React, { useState } from "react";
import {
  Collapse,
  Button,
  CardBody,
  Card,
  Form,
  FormGroup,
  Label,
  Input,
} from "reactstrap";

const SearchComp = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div>
      <Button
        block
        color="success"
        onClick={toggle}
        style={{ marginBottom: "1rem", marginTop: "1rem" }}
      >
        Filter
      </Button>
      <Collapse isOpen={isOpen}>
        <Form>
          <FormGroup>
            <Input type="text" name="name" placeholder="Per Name" />
          </FormGroup>
          <FormGroup>
            <Input
              type="text"
              name="governorate"
              placeholder="Per Gouvernorate"
            />
          </FormGroup>
          <FormGroup>
            <Input type="text" name="city" placeholder="Per City" />
          </FormGroup>
        </Form>
      </Collapse>
    </div>
  );
};

export default SearchComp;
